import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

let name = 'Ryan'
let green = '#ff1212'
let headerStyle = { color: green, 'font-size': '50px' }

class Filter extends Component {
  render() {
    return (
      <div>
        <img />
        <input type="text" />
        Filter
      </div>
    )
  }
}

class Aggregate extends Component {
  render() {
    return (
      <div style={{ width: '40%', color: '#ccc', display: "inline-block" }}>
        <h2>
          Number Text
          </h2>
          </div>
    )
  }
}
function App() {

  return (
    <div className="App">
      <h1 style={{color:'#fff'}}>Title</h1>
      <Aggregate />
      <Aggregate />
    </div>
  );
}

export default App;
